gj6(){return"\u039a\u03b5\u03b9\u03bc\u03ad\u03bd\u03bf\u03c5, \u03b1\u03bd\u03c5\u03c8\u03c9\u03bc\u03ad\u03bd\u03b1, \u03bc\u03b5 \u03c0\u03b5\u03c1\u03af\u03b3\u03c1\u03b1\u03bc\u03bc\u03b1 \u03ba.\u03b1."},
