gkg(){return"\u03a4\u03b1 \u03b1\u03bd\u03c5\u03c8\u03c9\u03bc\u03ad\u03bd\u03b1 \u03ba\u03bf\u03c5\u03bc\u03c0\u03b9\u03ac \u03c0\u03c1\u03bf\u03c3\u03b8\u03ad\u03c4\u03bf\u03c5\u03bd \u03b4\u03b9\u03ac\u03c3\u03c4\u03b1\u03c3\u03b7 \u03c3\u03c4\u03b9\u03c2 \u03ba\u03c5\u03c1\u03af\u03c9\u03c2 \u03b5\u03c0\u03af\u03c0\u03b5\u03b4\u03b5\u03c2 \u03b4\u03b9\u03b1\u03c4\u03ac\u03be\u03b5\u03b9\u03c2. \u0394\u03af\u03bd\u03bf\u03c5\u03bd \u03ad\u03bc\u03c6\u03b1\u03c3\u03b7 \u03c3\u03b5 \u03bb\u03b5\u03b9\u03c4\u03bf\u03c5\u03c1\u03b3\u03af\u03b5\u03c2 \u03c3\u03b5 \u03b3\u03b5\u03bc\u03ac\u03c4\u03bf\u03c5\u03c2 \u03ae \u03bc\u03b5\u03b3\u03ac\u03bb\u03bf\u03c5\u03c2 \u03c7\u03ce\u03c1\u03bf\u03c5\u03c2."},
gdX(){return"\u039a\u03bf\u03c5\u03bc\u03c0\u03af \u03bc\u03b5 \u03c0\u03b5\u03c1\u03af\u03b3\u03c1\u03b1\u03bc\u03bc\u03b1"},
gl6(){return"\u03a4\u03b1 \u03ba\u03bf\u03c5\u03bc\u03c0\u03b9\u03ac \u03bc\u03b5 \u03c0\u03b5\u03c1\u03af\u03b3\u03c1\u03b1\u03bc\u03bc\u03b1 \u03b3\u03af\u03bd\u03bf\u03bd\u03c4\u03b1\u03b9 \u03b1\u03b4\u03b9\u03b1\u03c6\u03b1\u03bd\u03ae \u03ba\u03b1\u03b9 \u03b1\u03bd\u03c5\u03c8\u03ce\u03bd\u03bf\u03bd\u03c4\u03b1\u03b9 \u03ba\u03b1\u03c4\u03ac \u03c4\u03bf \u03c0\u03ac\u03c4\u03b7\u03bc\u03b1. \u03a3\u03c5\u03c7\u03bd\u03ac \u03c3\u03c5\u03bd\u03b4\u03c5\u03ac\u03b6\u03bf\u03bd\u03c4\u03b1\u03b9 \u03bc\u03b5 \u03b1\u03bd\u03c5\u03c8\u03c9\u03bc\u03ad\u03bd\u03b1 \u03ba\u03bf\u03c5\u03bc\u03c0\u03b9\u03ac \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c5\u03c0\u03bf\u03b4\u03b5\u03af\u03be\u03bf\u03c5\u03bd \u03bc\u03b9\u03b1 \u03b5\u03bd\u03b1\u03bb\u03bb\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae, \u03b4\u03b5\u03c5\u03c4\u03b5\u03c1\u03b5\u03cd\u03bf\u03c5\u03c3\u03b1 \u03b5\u03bd\u03ad\u03c1\u03b3\u03b5\u03b9\u03b1."},
gef(){return"\u039a\u03bf\u03c5\u03bc\u03c0\u03b9\u03ac \u03b5\u03bd\u03b1\u03bb\u03bb\u03b1\u03b3\u03ae\u03c2"},
